/*Table structure for table `nota` */

DROP TABLE IF EXISTS `nota`;

CREATE TABLE `nota` (
  `nota_id` int(10) NOT NULL AUTO_INCREMENT,
  `nota_nombre` varchar(255) DEFAULT NULL,
  `nota_descripcion` varchar(255) DEFAULT NULL,
  `color` varchar(50) DEFAULT NULL,
  `color_bg` varchar(50) DEFAULT NULL,
  `etiqueta_bootstrap` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`nota_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

/*Data for the table `nota` */

insert  into `nota`(`nota_id`,`nota_nombre`,`nota_descripcion`,`color`,`color_bg`,`etiqueta_bootstrap`) values (1,'A','Fruta sobresaliente tanto en Calidad como en Condicion','#000099','#00ace6','primary'),(2,'B','Fruta de buena Calidad y Condicion','#006600','#00e68a','success'),(3,'C','Fruta que apenas esta dentro de los limites de aceptacion','#ffff00','#e6e600','warning'),(4,'O','Fruta que sobrepasa levemente la tolerancia Maxima de defectos','#ff0000','#e65c00','danger'),(5,'X','rechazo','#808080','#262626','secondary');

/*Table structure for table `oauth_access_tokens` */

DROP TABLE IF EXISTS `oauth_access_tokens`;

CREATE TABLE `oauth_access_tokens` (
  `id` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `user_id` int(11) DEFAULT NULL,
  `client_id` int(11) NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `scopes` text COLLATE utf8_unicode_ci,
  `revoked` tinyint(1) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `expires_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `oauth_access_tokens_user_id_index` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

