/* Function  structure for function  `nota_final` */

/*!50003 DROP FUNCTION IF EXISTS `nota_final` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `nota_final`(in_nota INT,in_categoria INT ) RETURNS varchar(50) CHARSET latin1
    NO SQL
BEGIN
    DECLARE nota VARCHAR(50);
   SET nota = "X";
   IF in_categoria = 2 THEN
	IF in_nota = 1 THEN
		SET nota = "A";
	END IF;
	IF in_nota = 2 THEN
		SET nota = "B";
	END IF;
	IF in_nota = 3 THEN
		SET nota = "C";
	END IF;
	IF in_nota = 4 THEN
		SET nota = "0";
	END IF;
   END IF;
   IF in_categoria = 1 THEN
	IF in_nota = 1 THEN
		SET nota = "A";
	END IF;
	IF in_nota = 2 THEN
		SET nota = "B";
	END IF;
	IF in_nota > 2 AND in_nota <=3  THEN
		SET nota = "B";
	END IF;
   END IF;
   RETURN nota;
END */$$
DELIMITER ;

